

#importing necessary libraries

from http.server import HTTPServer, BaseHTTPRequestHandler

from io import BytesIO
import json
import webbrowser
import requests

class SimpleHTTPRequestHandler(BaseHTTPRequestHandler):

    def do_GET(self):
        self.send_response(200)
        self.end_headers()
        self.wfile.write(b'Hello, world!')

    def do_POST(self):
        content_length = int(self.headers['Content-Length'])
        body = self.rfile.read(content_length)
        self.send_response(200)
        self.end_headers()
        response = BytesIO()
        response.write(b'This is POST request. ')
        response.write(b'Received: ')
        response.write(body)
        self.wfile.write(response.getvalue())

#put the ip address of the telepresence unit where the picture has to be displayed

        url = "http://10.105.16.101/putxml"


#the below is the raw form of the image that has to be added in the telepresence units

        payload = "<Command><UserInterface><Branding><Upload><Type>Background</Type><body></body></Upload></Branding></UserInterface></Command>"
        headers = {
            'Content-Type': "application/x-www-form-urlencoded",
            'Authorization': "Basic aW50ZWdyYXRvcjppbnRlZ3JhdG9y"
            }

        response = requests.request("POST", url, data=payload, headers=headers)

        print(response.text)
        webbrowser.open('http://localhost:3333/?name='+str(json.loads(body).get("roomId")))


#calling the function defined above 
httpd = HTTPServer(('localhost', 5000), SimpleHTTPRequestHandler)
